import { TOKEN_VALIDATED, USER_FETCHED } from '../types/auth'
import {toastr} from 'react-redux-toastr'

const url = process.env.REACT_APP_SERVER_URL

export function login(values) {
    const params = Object.keys(values).map((key) => {
        return encodeURIComponent(key) + '=' + encodeURIComponent(values[key])
    }).join('&')
    return dispatch => {
        fetch(`${url}/Customer/auth`, {
            method: 'POST',
            headers: {
                'Content-Type': 'application/x-www-form-urlencoded'
            },
            body: params
        })
        .then(response => {
            if (!response.ok) {
                throw response
            }
            return response.text()
        })
        .then(response => {
            const token = response
            dispatch([
                { type: USER_FETCHED, payload: {
                    token: token,
                    email: values.email,
                    image: 'data:image/png;base64,'
                }}
            ])
        })
        .catch(error => {
            return error.json()
                .then(error => {
                    dispatch([
                        { type: TOKEN_VALIDATED, payload: false }
                    ])
                    toastr.error('Erro', error.message)
                })
        })
    }
}

export function logout(token) {
    return dispatch => {
        dispatch({type: TOKEN_VALIDATED, payload: false})
    }
}

export function validateToken(token) {
    return dispatch => {
        if (token) {
           dispatch({type: TOKEN_VALIDATED, payload: true})
        } else {
            dispatch({type: TOKEN_VALIDATED, payload: false})
        }
    }
}